(10, 62, 6, 6, 'Barronfam.net', 'barronfamnet', 'barronfam.net', 'branch/logos/33962_425990057421250_360802343_n.jpg', '', 'branch/cupon/lo_1.jpg', '<head>\r\n<style type="text/css">\r\n p.MsoNormal\r\n	{margin-bottom:.0001pt;\r\n	font-size:12.0pt;\r\n	font-family:"Times New Roman","serif";\r\n		margin-left: 0in;\r\n	margin-right: 0in;\r\n	margin-top: 0in;\r\n}\r\n</style>\r\n</head>\r\n\r\n<body>\r\n\r\n<p class="MsoNormal">\r\n&nbsp;</p>\r\n										<form>\r\n										Your Mobile Number :\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="10" value="Mobile Number"/>									\r\n										<br />\r\n										\r\n			<label for="text_carrier">Carrier:<br></label>\r\n		 	<select name="carrier" class="requiredValidation doValidation nonZeroGuidValidation text_carrier">\r\n			<option value="00000000-0000-0000-0000-000000000000" selected="selected">Make selection</option>\r\n			<option value="mms.alltelwireless.com">Alltel</option>\r\n			<option value="mms.att.net">AT&T</option>\r\n			<option value="txt.bell.ca">Bell Mobility</option>\r\n			<option value="myboostmobile.com">Boost Mobile</option>\r\n			<option value="mobile.celloneusa.com">Cellular One</option>\r\n			<option value="mms.att.net">Cingular</option>\r\n			<option value="comcastpcs.textmsg.com">Comcast</option>\r\n			<option value="mms.mycricket.com">Cricket</option>\r\n			<option value="sms.fido.ca">Fido Solutions</option>\r\n			<option value="messaging.sprintpcs.com">Helio</option>\r\n			<option value="messaging.nextel.com">Nextel</option>\r\n			<option value="qwestmp.com">Qwest</option>\r\n			<option value="pcs.rogers.com">Rogers Wireless</option>\r\n			<option value="pm.sprint.com">Sprint</option>\r\n			<option value="tmomail.net">T-Mobile</option>\r\n			<option value="msg.telus.com">Telus/Telus Mobility</option>\r\n			<option value="vzwpix.com">Verizon</option>\r\n			<option value="vmpix.com">Virgin Mobile</option>\r\n		  </select>\r\n		  <span class="error"></span>\r\n	<br>\r\n										Your Zip Code&nbsp; :\r\n										<br />\r\n										<input type="tel" maxlength="5" name="zipcode"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Zip Code"/><br>\r\n										<input type="checkbox" name="vehicle" value="Bike">Yes i \r\n											would like a copy of the coupon send \r\n											to me via MMS<br></form>\r\n										<a href=""> <button>Submit</button></a>\r\n										\r\n										<?php\r\n $cellphone = $_POST[''number''];\r\n $carrier = $_POST[''carrier''];\r\n echo "$cellphone@$carrier";\r\n?>\r\n\r\n</body>\r\n', '', '', '', '', '', '', 0, '', '', 0, '1912 Acosta ', '', 'Anthony ', 'NM ', '88021', '<META http-equiv="refresh" content="0.0001; url=http://www.barronfam.net.com">', 'branch/cupon/info/lo_1.jpg', '', ''),
