(32, 10202, 22, 5, 'Checkin', 'checkin', ' ', 'branch/logos/sp.png', '<img src="http://whiteyball.files.wordpress.com/2007/04/greer-stadium-2.jpg" width="800">', '', '<html>\r\n\r\n<head>\r\n<meta content="en-us" http-equiv="Content-Language" />\r\n<meta content="text/html; charset=utf-8" http-equiv="Content-Type" />\r\n<title>701010 SPORTS History Check-In</title>\r\n</head>\r\n\r\n<body>\r\n\r\n<h2 style="margin: 10px 0px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-weight: bold; line-height: 40px; color: rgb(0, 146, 72); text-rendering: optimizelegibility; font-size: 30px; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">\r\n701010 SPORTS History<br /> Check-In</h2>\r\n<p>&nbsp;</p>\r\n\r\nIn order to receive your 701010 SPORT Passport stamps, <br />\r\nyou must create a user login and password. This<br />\r\nis your mobile number and your zip code. Your<br />\r\nstamps and any 701010 SPORT History cards will be<br />\r\ndelivered via MMS message to your mobile phone. <br />\r\nYou will use this info every time you check-in.<br />\r\n<br />\r\n										<form>\r\n										Your Mobile Number :\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="10" value="Mobile Number"/>\r\n										<br />\r\n										Your Zip Code&nbsp; : 										<br />\r\n										<input type="tel" maxlength="5" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Zip Code"/>\r\n										<br />\r\n										\r\n<script type="text/javascript">\r\n<!--\r\nfunction PopupCenter()\r\n  {\r\n  alert(''\\t''+ "701010 SPORTS" + ''\\n\\t'' + "Your Passport Hass Been Stamped!" + ''\\n\\t'' + "Greer Stadium" + ''\\n\\t'' + "December 4, 2012");\r\n  }//-->\r\n</script><br />\r\n<input type="button" onclick="PopupCenter()" value="Stamp Your Passport">;\r\n									<br />\r\n\r\n\r\n\r\n	<br />\r\n										</form>\r\n\r\n</body>\r\n\r\n</html>\r\n', '', '', '', '', '', '', 0, '', '', 0, '', '', '', '', '', '', '', '', ''),
(33, 651635, 23, 5, 'Choice', 'choice', 'Charlotte Knights ', 'branch/logos/Knights_1.png', '', 'branch/cupon/0339_001.jpg', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n\r\n<head>\r\n<meta content="en-us" http-equiv="Content-Language" />\r\n<meta content="text/html; charset=utf-8" http-equiv="Content-Type" />\r\n<title>Untitled 1</title>\r\n<style type="text/css">\r\n.style1 {\r\n	font-size: x-large;\r\n}\r\n</style>\r\n</head>\r\n\r\n<body>\r\n\r\n<p class="style1"><strong>\r\n<a href="http://www.baseball-reference.com/players/t/thomeji01.shtml">\r\nJim Thome stats. Click here for updated stats </a></strong></p>\r\n<body>\r\n\r\n</body>\r\n\r\n</html>\r\n', '', '', '', '', '', '', 0, '', '', 0, 'Test dir', 'Test dir 2', 'adf', 'dsfasdf', '32157', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but al', 'branch/cupon/info/images_12.jpg', '', ''),
(34, 20200, 24, 5, 'TOYOTA', 'toyota', 'TOYOTHON IS ON! ', 'branch/logos/toyota.jpg', '<iframe width="560" height="315" src="http://www.youtube.com/embed/74JWI5oYCxQ" frameborder="0" allowfullscreen></iframe>', '', 'Over the past 33 years, Toyotathon has become the premier event in the automotive industry. Historically, Toyotathon is the best time of the year to purchase a new car, truck or SUV.', '', '', '', '', '', '', 0, '', '', 0, '', '', '', '', '', '', '', '', ''),
(35, 202, 25, 7, 'Budweiser,', 'budweiser', 'Budweiser', 'branch/logos/budweiser.png', '', '', '<head>\r\n<style type="text/css">\r\n.style1 {\r\n	text-align: center;\r\n}\r\n</style>\r\n</head>\r\n\r\n<div class="style1" style="width: 509px; height: 398px">\r\n<body>\r\n\r\n<p class="style1">\r\n<span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">ID Please<br />You must be \r\nof legal drinking age to enter this site. Please present your ID by entering \r\nyour date of birth below.</span></p>\r\n<p class="style1">\r\n<span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">&nbsp;&nbsp; </span>&nbsp;<select name="month" onChange="changeDate(this.options[selectedIndex].value);" style="width: 90px">\r\n<option value="na">Month</option>\r\n<option value="1">January</option>\r\n<option value="2">February</option>\r\n<option value="3">March</option>\r\n<option value="4">April</option>\r\n<option value="5">May</option>\r\n<option value="6">June</option>\r\n<option value="7">July</option>\r\n<option value="8">August</option>\r\n<option value="9">September</option>\r\n<option value="10">October</option>\r\n<option value="11">November</option>\r\n<option value="12">December</option>\r\n</select>\r\n<select name="day" id="day" style="width: 68px">\r\n<option value="na">Day</option>\r\n</select>\r\n<select name="year" id="year" style="width: 70px">\r\n<option value="na">Year</option>\r\n</select>\r\n<script language="JavaScript" type="text/javascript">\r\nfunction changeDate(i){\r\nvar e = document.getElementById(''day'');\r\nwhile(e.length>0)\r\ne.remove(e.length-1);\r\nvar j=-1;\r\nif(i=="na")\r\nk=0;\r\nelse if(i==2)\r\nk=28;\r\nelse if(i==4||i==6||i==9||i==11)\r\nk=30;\r\nelse\r\nk=31;\r\nwhile(j++<k){\r\nvar s=document.createElement(''option'');\r\nvar e=document.getElementById(''day'');\r\nif(j==0){\r\ns.text="Day";\r\ns.value="na";\r\ntry{\r\ne.add(s,null);}\r\ncatch(ex){\r\ne.add(s);}}\r\nelse{\r\ns.text=j;\r\ns.value=j;\r\ntry{\r\ne.add(s,null);}\r\ncatch(ex){\r\ne.add(s);}}}}\r\ny = 2010;\r\nwhile (y-->1909){\r\nvar s = document.createElement(''option'');\r\nvar e = document.getElementById(''year'');\r\ns.text=y;\r\ns.value=y;\r\ntry{\r\ne.add(s,null);}\r\ncatch(ex){\r\ne.add(s);}}\r\n</script>&nbsp; <a href="http://nfc.701010.com/budweiser/89128/budweiser1/"> <button>Submit</button> </a><br /><span class="style2">The year, month, or day was not a number. <br /> [Month/Day/Year]\r\n</span>\r\n</p>\r\n<p class="style1">\r\n<span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">From Budweiser, the \r\nGreat American Lager, to the Budweiser Clydesdales, through to our ads and \r\ntelevision commercials, making friends has always been our first order of \r\nbusiness, and our first priority. In fact, those people who brew, deliver and \r\nserve Budweiser are your friends and neighbors. That’s why we’ll continue to \r\nbrew Budweiser and all our great beers with the commitment to quality you’ve \r\ncome to expect, ‘cause after all, friends are worth it. And like the great taste \r\nof an ice-cold Budweiser, that won’t change</span></p>\r\n<p class="style1">\r\n&nbsp;</p>\r\n\r\n</body>\r\n</div>', '', '', '', '', '', '', 0, 'branch/background/budweiser_1.jpg', '', 0, '', '', '', '', '', '', '', '', ''),
(38, 50156, 25, 4, 'Budweiser1', 'budweiser1', 'Budweiser', 'branch/logos/budweiser_3.png', '<iframe width="560" height="315" src="http://www.youtube.com/embed/4Lmtwsgn8Eg" frameborder="0" allowfullscreen></iframe>', '', '<body>\r\n\r\nEvent: MADE IN AMERICA Sponsored by BUDWEISER\r\n<br />\r\n<br />\r\nHEADER WILL BE: MADE IN AMERICA 2013.. REGISTER TO WIN!!\r\nAn exciting, two-day music festival in Philadelphia this Labor Day weekend. GREAT MUSICIANS will curate and headline the blockbuster roster of talent, which will include nearly 30 artists that embody the American spirit performing across three stages on the Benjamin Franklin Parkway in Philadelphia’s Fairmount Park.. DO NOT MISS THE MADE IN AMERICA EVENT 2013!! \r\n<br />\r\n										<form>\r\n										Your Mobile Number :\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="10" value="Mobile Number"/>\r\n										<br />\r\n										Your Zip Code&nbsp; : 										\r\n										<br />\r\n										<input type="tel" maxlength="5" name="zipcode"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Zip Code"/>\r\n										<br />\r\n										<br />\r\n										</form>\r\n										<a href="http://www.madeinamericafest.com"> <button>Submit</button></a>\r\n\r\n</body>\r\n', '', '', '', '', '', '', 0, 'branch/background/budweiser_2.jpg', '', 0, '', '', '', '', '', '', '', '', ''),
(39, 6165165, 25, 2, 'Budweiser2', 'budweiser2', 'Budweiser', 'branch/logos/budweiser_4.png', '<iframe width="560" height="315" src="http://www.youtube.com/embed/7uVe4aoIF60" frameborder="0" allowfullscreen></iframe>', '', '<head>\r\n<style type="text/css">\r\n p.MsoNormal\r\n	{margin-bottom:.0001pt;\r\n	font-size:12.0pt;\r\n	font-family:"Times New Roman","serif";\r\n		margin-left: 0in;\r\n	margin-right: 0in;\r\n	margin-top: 0in;\r\n}\r\n</style>\r\n</head>\r\n\r\n<body>\r\n\r\n<p class="MsoNormal">EVENT: Austin City Limits 2013<o:p></o:p></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">HEADER:&nbsp; ACL 2013 IS HEREE!!! Check the line up!! Be \r\nthe first to know who is playing and REGISTER TO WIN FREE TICKETS!!&nbsp;<o:p></o:p></p>\r\n<p class="MsoNormal">ACL: Great music, no limits!!&nbsp;<o:p></o:p></p>\r\n<p class="MsoNormal">\r\n<o:p></o:p></p>\r\n<p class="MsoNormal">\r\n<span style="font-size: 10.0pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; background: white">\r\nThe Austin City Limits Music Festival is an annual three-day American music \r\nfestival that takes place in Austin, Texas at the city&#39;s central public park, \r\nZilker Park</span><o:p></o:p></p>\r\n<br />\r\n										<form>\r\n										Your Mobile Number :\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="10" value="Mobile Number"/>\r\n										<br />\r\n										Your Zip Code&nbsp; : 										\r\n										<br />\r\n										<input type="tel" maxlength="5" name="zipcode"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Zip Code"/>\r\n										<br />\r\n										<br />\r\n										</form>\r\n										<a href="http://acltv.com"> <button>Submit</button></a>\r\n\r\n</body>\r\n', '', '', '', '', '', '', 0, 'branch/background/budweiser.jpg', '', 0, '', '', '', '', '', '', '', '', ''),
