(42, 1520, 27, 8, 'mcdonalds', 'mcdonalds', 'McDonalds', 'branch/logos/mcdonalds_logo_copy.jpg', '<iframe width="560" height="315" src="http://www.youtube.com/embed/PDgCbK7qD2Q" frameborder="0" allowfullscreen></iframe>', 'branch/cupon/Chicken_McNuggets__McDonalds.png', '<body>\r\nJoin the club. The club who loves the flavorful pork and tangy barbeque sauce of our favorite sandwich. We''re a discriminating group who don''t mind getting sticky.\r\n<br />\r\n<br />\r\n<a href="http://www.mcdonalds.com/us/en/food/product_nutrition.sandwiches.292.mcrib-.html">http://www.mcdonalds.com/us/en/food/product_nutrition.sandwiches.292.mcrib-.html\r\n</a>\r\n</body>\r\n', '', '', '', '', '', '', 0, '', '', 0, '', '', '', '', '', '', '', '', ''),
(43, 115, 26, 2, 'Heineken1', 'heineken1', 'Heineken', 'branch/logos/ha_1.png', '<iframe width="560" height="315" src="http://www.youtube.com/embed/MZtDqpdvy7s" frameborder="0" allowfullscreen></iframe>', '', '<head>\r\n<style type="text/css">\r\n p.MsoNormal\r\n	{margin-bottom:.0001pt;\r\n	font-size:12.0pt;\r\n	font-family:"Times New Roman","serif";\r\n		margin-left: 0in;\r\n	margin-right: 0in;\r\n	margin-top: 0in;\r\n}\r\n</style>\r\n</head>\r\n\r\n<body>\r\n\r\n<p class="MsoNormal">\r\n<img src="http://www.deviantart.com/download/63093705/tiesto_heineken_by_danyzazed.jpg" height="158" width="654"></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">REGISTER TO WIN A TICKET FOR TIESTO CONCERT!!<o:p></o:p></p>\r\n										<form>\r\n										Your Mobile Number :\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 98px; height: 24px" size="10" value="Mobile Number"/>\r\n										<br />\r\n										Your Zip Code&nbsp; : 										\r\n										<br />\r\n										<input type="tel" maxlength="5" name="zipcode"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Zip Code"/>\r\n										<br />\r\n										<br />\r\n										</form>\r\n										<a href="http://acltv.com"> <button>Submit</button></a>\r\n\r\n</body>\r\n', '', '', '', '', '', '', 0, 'branch/background/Untitled-2_1.png', '', 0, '', '', '', '', '', '', '', '', ''),
(44, 450152, 28, 8, 'Angeles', 'angeles', 'HOSPITAL ANGELES', 'branch/logos/hospital_angeles.png', '', '', '<style type="text/css">\r\n.style1 {\r\n	text-align: center;\r\n	font-size: large;\r\n}\r\n.style2 {\r\n	border-width: 0px;\r\n}\r\n.style3 {\r\n	font-size: medium;\r\n}\r\n.style4 {\r\n	text-align: center;\r\n}\r\n</style>\r\n\r\n<div style="width: 560px; height: 740px">\r\n<img src="http://www.quimicahj.com/images/logo.png"><br>\r\n<img src="http://www.quimicahj.com/tophospitales/ciudadjuarez1.jpg"><br>\r\n<br>\r\n	<p class="MsoNormal"><b>VISIÓN&nbsp;</b><o:p></o:p></p>\r\n	&quot;Ser el sistema de salud privado mejor integrado y con cobertura nacional, reconocido por la alta preparación y capacidad profesional de su equipo humano, la tecnología de su plataforma de servicios clínicos, el mejor servicio y la atención más cálida&quot;<br>\r\n	<br>\r\n	<br><div>\r\n		<img src="http://701010.com/images/nfc/bar.png" height="5" width="561"></div><br>\r\n	<p class="style1"><strong>¡PROGRAMA TU CONSULTA MEDICA!</strong><br />\r\n	<strong><span class="style3">Por favor llene la siguiente información</span></strong>\r\n	</p>\r\n										<form>\r\n										Ingrese su número de teléfono celular:\r\n										<br />\r\n										<input type="tel" maxlength="10" name="number"  onClick="this.value=''''" style="width: 111px; height: 24px" size="10" value="Teléfono celuar"/>\r\n										<br />\r\n										Ingrese su Código postal: 										\r\n										<br />\r\n										<input type="tel" maxlength="5" name="zipcode"  onClick="this.value=''''" style="width: 98px; height: 24px" size="5" value="Código postal"/>\r\n										<br>\r\n										Selecciona el Departamento Hospitalario\r\n										<br>\r\n										<select name="especialidad" size="1" style="width: 214px">\r\n                                        <option value="@x@" selected="selected">Seleccionar</option>\r\n                                                                                <option value="SS2