                        <option value="SS1900">\r\n                                          Cirugía Oncológica\r\n                                        </option>\r\n                                                                                <option value="SS2000">\r\n                                          Cirugia Pediátrica\r\n                                        </option>\r\n                                                                                <option value="SS2050">\r\n                                          Cirugia Plástica\r\n                                        </option>\r\n                                                                                <option value="SS2100">\r\n                                          Coloproctología\r\n                                        </option>\r\n                                                                                <option value="SS2600">\r\n                                          Gastroenterología\r\n                                        </option>\r\n                                                                                <option value="SS2800">\r\n                                          Ginecología y Obstetricia\r\n                                        </option>\r\n                                                                                <option value="SS3200">\r\n                                          Medicina del Trabajo\r\n                                        </option>\r\n                                                                                <option value="SS3250">\r\n                                          Medicina Familiar\r\n                                        </option>\r\n                                                                                <option value="SS20090327">\r\n                                          Medicina General                                        </option>\r\n                                        